var BlocklyGamesMsg={"Games.name":"Blockly Trò Chơi","Games.movie":"Phim","Games.linesOfCode1":"Bạn đã xử lý level này với 1 dòng của JavaScript:","Games.linesOfCode2":"Bạn đã xử lý level này với %1 dòng của JavaScript:","Games.nextLevel":"Bạn có sẵn sàng cho level %1 chưa?","Games.finalLevel":"Bạn có sẵn sàng cho level tiếp theo chưa?","Games.submitTitle":"Tên:","Games.linkTooltip":"Lưu và lấy địa chỉ liên kết.","Games.help":"Trợ giúp","Games.catLogic":"Logic","Games.catLoops":"Vòng lặp","Games.catMath":"Công thức toán","Games.catLists":"Danh sách","Games.catColour":"Màu","Games.catVariables":"Biến","Games.catProcedures":"Hàm","Games.httpRequestError":"Hoạt động bị trục trặc, không thực hiện được yêu cầu của bạn.","Games.linkAlert":"Chia sẻ chương trình của bạn với liên kết sau:\n\n %1","Games.hashError":"Không tìm thấy chương trình được lưu ở '%1'.","Games.submitted":"Cảm ơn phần mềm của bạn! Nếu dàn \"khỉ viên\" đã qua huấn luyện của chúng tôi thích phần mềm này, phần mềm sẽ được xuất bản vào thư viện trong vài ngày thôi.","Games.congratulations":"Chúc mừng!","Games.helpAbort":"Level này rất khó. Bạn có muốn bỏ qua và chuyển sang trò chơi tiếp theo? Bạn có thể quay lại level này sau.","Turtle.helpText10Reddit":"Sử dụng \"Xem Phòng trưng bày\" nhấn để xem những người khác đã vẽ. Nếu bạn vẽ nên thứ gì đặc sắc, hãy dùng \"Gửi đến Phòng trưng bày\" nhấn để trưng bày nó.","Movie.x":"x","Movie.y":"y","Movie.x1":"bắt đầu x","Movie.y1":"bắt đầu y","Movie.x2":"kết thúc x","Movie.y2":"kết thúc y","Movie.radius":"bán kính","Movie.width":"chiều ngang","Movie.height":"chiều cao","Movie.circleTooltip":"Hãy vẽ một hình tròn tại một vị trí cụ thể và với một bán kính cụ thể.","Movie.circleDraw":"hình tròn","Movie.rectTooltip":"Hãy vẽ một hình chữ nhật tại một vị trí cụ thể với chiều ngang và chiều cao cụ thể.","Movie.rectDraw":"hình chữ nhật","Movie.lineTooltip":"Hãy vẽ một đường thẳng từ một điểm đến điểm còn lại với một chiều ngang cụ thể.","Movie.lineDraw":"dòng","Movie.timeTooltip":"Hoàn trả thời điểm hiện tại ở phim (0-100).","Movie.colourTooltip":"Thay màu của bút vẽ.","Movie.setColour":"gán màu","Movie.galleryTooltip":"Mở phòng trưng bày của các phim.","Movie.galleryMsg":"Xem Phòng trưng bày","Movie.submitTooltip":"Gửi phim của bạn đến phòng trưng bày.","Movie.submitMsg":"Gửi đến phòng trưng bày","Movie.helpLayer":"Di chuyển nền hình tròn lên phần đầu của chương trình. Sau đó nó sẽ xuất hiện phía sau nhân vật.","Movie.helpText1":"Sử dụng các khối hình đơn giản để vẽ người này.","Movie.helpText2a":"Cấp độ này là một đoạn phim. Bạn muốn cánh tay của nhân vật di chuyển qua màn hình. Nhấn nút chơi để xem chương trình chạy.","Movie.helpText2b":"Khi đoạn phim được chiếu, giá trị của mảnh 'thời gian' đếm từ 0 đến 100.\nBạn muốn cho vị trí nằm ngang của cánh tay bắt đầu tại 0 và đi đến 100.","Movie.helpText3":"Mảnh 'thời gian' đếm từ 0 đến 100. Nhưng bây giờ bạn muốn vị trí nằm ngang của cánh tay bắt đầu tại 100 và đi đến 0. Bạn hãy tìm ra công thức toán đơn giản để đổi hướng đếm.","Movie.helpText4":"Sử dụng những gì bạn đã học trong những cấp độ trước để làm sao cho những cái chân bắt chéo nhau.","Movie.helpText5":"Phép toán cho cánh tay khá phức tạp. Đây là câu trả lời:","Movie.helpText6":"Đưa cho nhân vật hai bàn tay.","Movie.helpText7":"Sử dụng mảnh 'if' để vẽ một cái đầu nhỏ cho nửa đoạn đầu trình chiếu của phim. Sau đó vẽ một cái đầu lớn cho nửa đoạn sau của phim.","Movie.helpText8":"Làm cho những cái chân thay đổi hướng ở giữa chặng của đoạn phim.","Movie.helpText9":"Vẽ một vòng tròn mở rộng đằng sau nhân vật.","Movie.helpText10":"Tạo ra phim về mọi thứ bạn muốn. Bạn có thể khám phá cùng với một số lượng lớn mảnh mới. Chúc bạn vui vẻ."}
